import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { Spinner, Button, Form, Row, Col, Card } from 'react-bootstrap'
import { useInput } from '../Data/useInput';
import { constraintCheck } from '../Data/ConstraintCheck';
import VaccinesList from '../Components/VaccinesSelectDropDown'
import { HttpRequests } from '../Data/HttpRequest';
let [acknowledgementList, acknowledgementData] = [[], null]
const Distributions = (props) => {
    const [message, setMessage] = useState('')
    const config = {
        method: 'get',
        url: 'http://localhost:8765/api/distribution/acknowledge',
        headers: {
            'auth': localStorage.getItem('vmisJwt')
        }
    };
    let distributionData = HttpRequests(config)
    return (<div>
        <Row>
            {distributionData !== undefined && distributionData.data ? <Col>
            {Object.keys(distributionData.data)}
            <Card>
                <Card.Header>from </Card.Header>
                </Card></Col> : distributionData !== undefined && distributionData.loading ? <Col><Spinner animation={"border"} /></Col> : distributionData !== undefined && distributionData.error ? <Col><div className="alert alert-danger">Something went wrong</div></Col> : <Col><div className="alert alert-info">No un Acknowledged Distribution</div></Col>}
        </Row>
    </div>)
}

export default Distributions;
